import ExpenseItem from './ExpenseItem';

const items = ({ items }) => {
  return (
    <div>
    <ExpenseItem
      title={items[0].title}
      amount={items[0].amount}
      timepoint={items[0].timepoint}
    />
    <ExpenseItem
      title={items[1].title}
      amount={items[1].amount}
      timepoint={items[1].timepoint}
    />
    <ExpenseItem
      title={items[2].title}
      amount={items[2].amount}
      timepoint={items[2].timepoint}
    />
    <ExpenseItem
      title={items[3].title}
      amount={items[3].amount}
      timepoint={items[3].timepoint}
    />
    </div>
  );
}

export default items;
